int NoEights::smallestAmount(int low, int high) {
  string s;
  char buf [100];
  sprintf(buf, "%d", low);
  s = buf;
  
  int k8 = 0;
  for(int i = 0; i < s.size(); i++)
    if (s[i] == '8')
      k8++;
  
  int res = k8;
  for (int i = s.size() - 1; i >= 0; i--) 
    if (s[i] == '8') {
      s[i] = '9';
      for(int j = i + 1; j < s.size(); j++)
        s[j] = '0';
        
      if (atoi(s.c_str()) <= high)
        res--;
      else
        return res;
    }
    
  return res;
}
 
 
